import React from 'react';
import classes from './Layout.module.css';
import Toolbar from '../../components/UI/Toolbar/Toolbar';

const layout = props => (
    <React.Fragment>
        <Toolbar />
        <main className = {classes.Content}>
            {props.children}
        </main>
    </React.Fragment>
);

export default layout;
